function detailReportDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Report-detail').modal('show');

				$('#Detail-Report-Active').prop('checked', data.active);
				$('#Detail-Report-Description').val(data.description);
				$('#Detail-Report-Modul').val(data.modul);
				$('#Detail-Report-Name').val(data.name);
				$('#Detail-Report-Query').val(data.query);

}
